import React from 'react'

function Number(props) {
  const { number, remove } = props;

  const handleDelete = (num) => {
    remove(num);
  };

  return (
    <div>
      <h1>{number}</h1>
      <button onClick={() => handleDelete(number)}>Delete</button>
    </div>
  )
}

export default Number
